import './App.css';

function VocabCard(props) {
  return (
    <div className="VocabCard">
      <h3>N/A</h3>
      <h3>{props.characters}</h3>
      <h3>{props.romaji}</h3>
      <h3>{props.part}</h3>{/*noun, verb, adjective, adverb, pronoun, preposition, conjunction, interjection, numeral, article, or determiner*/}
      <h3>Definitions: {props.meaning}</h3>
      <h2>Example Sentences</h2>
      <hr/>
      <h3>COMING SOON</h3>
    </div>
  );
}

export default VocabCard;
